CREATE DATABASE IF NOT EXISTS provaSenatori;
USE provaSenatori;

CREATE TABLE mytable(
   senatore         VARCHAR(36) NOT NULL PRIMARY KEY
  ,nome             VARCHAR(28) NOT NULL
  ,cognome          VARCHAR(19) NOT NULL
  ,sesso            VARCHAR(1) NOT NULL
  ,legislatura      INTEGER  NOT NULL
  ,inizioMandato    DATE  NOT NULL
  ,fineMandato      VARCHAR(30)
  ,tipoMandato      VARCHAR(56) NOT NULL
  ,tipoFineMandato  VARCHAR(30)
  ,dataNascita      DATE  NOT NULL
  ,cittaNascita     VARCHAR(27) NOT NULL
  ,provinciaNascita VARCHAR(21)
  ,nazioneNascita   VARCHAR(11) NOT NULL
);
